import React, { useRef } from 'react'
import { useGLTF } from '@react-three/drei'

export function BluePill(props) {
  const group = useRef()
  const { nodes } = useGLTF('/BluePill/BluePill.gltf')
  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene">
        <mesh name="BluePill" geometry={nodes.BluePill.geometry} position={[0.39, 1.32, 0]} scale={0.75}>
          <meshStandardMaterial color="#2f55d4"/>
          <mesh name="MovingBlock2" geometry={nodes.MovingBlock2.geometry} position={[0.01, -1.98, 0.02]} scale={0.83}>
            <meshStandardMaterial color="white"/>
          </mesh>
        </mesh>
      </group>
    </group>
  )
}

useGLTF.preload('/BluePill/BluePill.gltf')
